DROP TABLE IF EXISTS `s_log_access`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `s_log_access` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '操作日志记录',
  `login_name` varchar(45) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '模块标题',
  `ip` varchar(20) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '业务类型（0其它 1新增 2修改 3删除）',
  `location` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '方法名称',
  `browser` varchar(45) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '操作类别（0其它 1后台用户 2手机端用户）',
